Let‚Äôs have ultimate fun this weekend with Chinese  buns . 

These are steam buns filled with sweet potatoes. Traditionally buns are filled with red bean paste but I decided to try something different , no sugar added and It was so delicious. You can use same recipe with savory fillings as well . 

Let‚Äôs have steamed buns : 12 small ones 

-2 large sweet potatoes, boiled and mashed 

-Dough:
2 cups all purpose flour
1.5 tsp instant yeast
3/4 cup water 
1/3 cup sugar 
1 tbsp oil 
Small amount of salt 

Mix ingredients, make a smooth ball , cover and let it rise about 30 minutes , it should be rise 50% . 
Take the dough, work a little and divide them into  12 Pcs. Make smooth balls , keep them covered while you are working on others .

Using rolling pins , flatten to  3‚Äù / 8 cm , make edges thinner . Place 1 tbsp fillings , gather edges  and  pinch to secure . Cover all buns and let them rest 20 min . Meanwhile start heating water in a pot for your steamer . 

When water is simmering , place oven papers in your bamboo steamer to prevent sticking. Place 6 buns on each layer of steamer ( I had 2 layers)  cover and cook 20 min. Turn of the heat , rest 5 min . covered in the steamer . Enjoy üòä 

